def num_decodings(s: str) -> int:
    def recursive_with_memo(index: int, memo: dict) -> int:
        if index == len(s): return 1
        if s[index] == '0': return 0
        if index == len(s) - 1: return 1
        if index in memo: return memo[index]

        ans = recursive_with_memo(index + 1, memo)
        if int(s[index: index + 2]) <= 26:
            ans += recursive_with_memo(index + 2, memo)

        memo[index] = ans
        return ans
    return recursive_with_memo(0, {})
